import React, { useEffect, useState } from 'react';
import axios from 'axios';

function User() {
    const [dummyData, setDummyData] = useState({
        age: [],
        gender: [],
        profession: []
    });
    const [user, setUser] = useState({
        firstName: '',
        lastName: '',
        age: '',
        gender: '',
        profession: ''
    });

    // Fetch dummy data from the backend
    useEffect(() => {
        axios.get('http://localhost:5000/api/users/dummy-data')
            .then(response => {
                setDummyData(response.data);
            })
            .catch(error => {
                console.error('Error fetching dummy data:', error);
            });
    }, []);

    // Handle form input change
    const handleChange = (e) => {
        const { name, value } = e.target;
        setUser(prevUser => ({
            ...prevUser, [name]: value
        }));
    };

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post('http://localhost:5000/api/users', user)
            .then(response => {
                alert('User created successfully!');
            })
            .catch(error => {
                console.error('Error creating user:', error);
            });
    };

    return (
        <div className="App">
            <h1>Create User</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    First Name:
                    <input 
                        type="text" 
                        name="firstName" 
                        value={user.firstName} 
                        onChange={handleChange} 
                        required
                    />
                </label>
                <br /><br />
                <label>
                    Last Name:
                    <input 
                        type="text" 
                        name="lastName" 
                        value={user.lastName} 
                        onChange={handleChange} 
                        required
                    />
                </label>
                <br /><br />
                <label>
                    Age:
                    <select name="age" value={user.age} onChange={handleChange} >
                        <option value="">Select Age</option>
                        {dummyData.age.map((age, index) => (
                            <option key={index} value={age}>{age}</option>
                        ))}
                    </select>
                </label>
                <br /><br />
                <label>
                    Gender:
                    <select name="gender" value={user.gender} onChange={handleChange} >
                        <option value="">Select Gender</option>
                        {dummyData.gender.map((gender, index) => (
                            <option key={index} value={gender}>{gender}</option>
                        ))}
                    </select>
                </label>
                <br /><br />
                <label>
                    Profession:
                    <select name="profession" value={user.profession} onChange={handleChange}>
                        <option value="">Select Profession</option>
                        {dummyData.profession.map((profession, index) => (
                            <option key={index} value={profession}>{profession}</option>
                        ))}
                    </select>
                </label>
                <br /><br />
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}

export default User;
